import React from "react";

const Article = ({ urlToImage, title, publishedAt, description, url }) => {
  return (
    <div>
      <image src={urlToImage} alt="article-image" />
      <h3>title</h3>
      <p>{description}</p>
    </div>
  );
};

export default Article;
